            int iCountOfQ1 = 0;
            int iCountOfQ2 = 0;

            // SOIL DATA
            for (int i=0; i < soilData.Length; i++)
            {
                if ((soilData[i].ChemCode.StartsWith("654")) && (soilData[i].Result > 2)) iCountOfQ1++;
