            // Grouping of each data by Location and Date
            var groupedWaterData = waterData.GroupBy(data => new { data.Location, data.Date }).ToArray();
            var groupedSoilData = soilData.GroupBy(data => new { data.Location, data.Date }).ToArray();

            // Nested list which later will be converted into a 2-D array
            List<List<object>> groupedData = new List<List<object>>();

            // Function calls to construct our nested list
            fillData(groupedWaterData, groupedData);
            fillData(groupedSoilData, groupedData);

