        // Purpose: Takes anonymous type as an argument (i.e., our grouped array), and a nested list of objects, 
        //          and adds all the grouped data into the nested list and returns the updated nested list
        public static List<List<object>> fillData(IEnumerable<dynamic> myGroupedArray, List<List<object>> myGroupedList)
        {
            // For each key (i.e., group)
            foreach(var data in myGroupedArray)
            {
                List<object> tempList = new List<object>();

                // For each data in key
                foreach (var allData in data)
                {
                    tempList.Add(allData);
                }

                // Add into the nested list
                myGroupedList.Add(tempList);
            }
            return myGroupedList;
        }

        //---------------------------------------------------------------------------------------------------//

    }
}